Here's a Swift class that creates a stack of images and scales them based on the given scale factor:

```swift
import UIKit

class StackedImages: UIView {
    private var layers: [CALayer] = []
    private var iconScale: CGFloat = 0.70

    init(layers: [UIImage], iconScale: CGFloat = 0.70) {
        super.init(frame: .zero)
        self.iconScale = iconScale
        setupLayers(layers: layers)
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers(layers: [UIImage]) {
        for (index, image) in layers.enumerated() {
            let layer = CALayer()
            layer.contents = image.cgImage
            layer.contentsGravity = .resizeAspectFill
            layer.contentsScale = UIScreen.main.scale
            layer.masksToBounds = true
            self.layers.append(layer)
            self.layer.addSublayer(layer)
        }
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) / 2

        for (index, layer) in layers.enumerated() {
            layer.frame = CGRect(x: iconsInset, y: iconsInset, width: iconsSize, height: iconsSize)
            layer.position = CGPoint(x: bounds.midX, y: bounds.midY)

            switch index {
            case 1:
                layer.frame.origin.x = 0
                layer.frame.origin.y = iconsInset
            case 0:
