Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read
      .textFile("path/to/onsite/data")
      .javaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read
      .textFile("path/to/top/queries")
      .javaRDD

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache = mutable.Map[String, Long]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val currentTime = System.currentTimeMillis()
      val hitMiss = new ListBuffer[(String, Boolean)]()

      while (iter.hasNext) {
        val line = iter.next()
        val Array(query, timestamp) = line.split(" ")

        // Check if query is in top queries
        if (broadcastTopQueries.value.contains(query)) {
          // Check if query is in cache
          if (cache.contains(query)) {
            // Check if query is still valid in cache
            if (currentTime - cache(query) <= 12 * 60 * 60 * 1000) {
              // Cache hit
              hitMiss.append((query, true))
            } else {
              // Cache miss, update cache
              cache.put(query, currentTime)
              hitMiss.append((query, false))
            }
          } else {
            // Cache miss, update cache
            cache.put(query, currentTime)
            hitMiss.append((query, false))
          }
        }
      }

      hitMiss.iterator
    }).reduce((a, b) => (a._1, a._2 || b._2))

    // Calculate hit rate
    val totalQueries = onsiteData.count()
    val hitCount = hitRate._2 ? 1L | 0L
    val hitRate = hitCount.toDouble / totalQueries.toDouble

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from their respective paths. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes an empty cache to store the queries and their timestamps. It processes the onsite data by iterating over each record and checking if the query is in the top frequent queries. If it is, the job checks if the query is in the cache and if it is still valid (i.e., within the 12-hour window). If the query is in the cache and still valid, it is a cache hit. Otherwise, it is a cache miss and the cache is updated with the current timestamp.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite data.

